import  { createGlobalStyle } from 'styled-components';
export const IconStyle = createGlobalStyle`
	@font-face {font-family: "iconfont";
  src: url('./iconfont.eot?t=1565008073950'); /* IE9 */
  src: url('./iconfont.eot?t=1565008073950#iefix') format('embedded-opentype'), /* IE6-IE8 */
  url('data:application/x-font-woff2;charset=utf-8;base64,') format('woff2'),
  url('./iconfont.woff?t=1565008073950') format('woff'),
  url('./iconfont.ttf?t=1565008073950') format('truetype'), /* chrome, firefox, opera, Safari, Android, iOS 4.2+ */
  url('./iconfont.svg?t=1565008073950#iconfont') format('svg'); /* iOS 4.1- */
}

.iconfont {
  font-family: "iconfont" !important;
  font-size: 16px;
  font-style: normal;
  -webkit-font-smoothing: antialiased;
  -moz-osx-font-smoothing: grayscale;
}
`;
